import React, { useState } from "react";
import Tour from "reactour";

const TourGuide = (steps, isTourOpen, setIsTourOpen) => {
  return (
    <Tour
      onRequestClose={() => setIsTourOpen(false)}
      steps={steps}
      isOpen={isTourOpen}
      accentColor="#5cb7b7"
    />
  );
};
export default TourGuide;
